using UnityEngine;
using System.Collections;
using System.IO;

//Because using random.seed is not 100% guaranteed to produce identical results in different environments, versions of .NET,  or different types of processors.
//this algorithm will always produce 100% predictable results if the random data at the end of this file is the same among computers.

// in order to replicate 'random' activity on remote computers,  this class can be used to simulate such effects and make them appear random.

//NOTE: random seeds outside of 0-100000 are converted to seeds within 0-100000 and are not relevant.

public class randomTable : MonoBehaviour {

    
    public uint seed = 0;  //the seed acts as the position iterator over the random data array.

    /// <summary>
    /// get an signed int between -uint max and uint max
    /// </summary>
    public int getInt()
    {
        seed += 4; return getInt(seed); 
    }
    public int getInt(int min, int max)
    {
        seed += 4; return getInt(min, max, seed);
    }
    /// <summary>
    /// a 'random' float from -1 to 1
    /// </summary>
    public float getFloat()
    {
        seed += 4; return getFloat(seed);
    }
    public float getFloat(float min, float max)
    {
        seed += 4; return getFloat(min, max, seed); 
    }
    /// <summary>
    /// a 'random' float from 0 to 1
    /// </summary>
    public float getValue()
    {
        seed += 4; return getValue(seed); 
    }

    public bool getBool()
    {
        seed++; return getBool(seed); 
    }

    public byte getByte()
    {
        seed++; return getByte(seed);
    }

    //////////////////////////////////////////////////////////////////////// the versions below give the seed directly, leaving the iterator untouched (if it is already within the array, otherwise it corrects it)

    //note that all calls depend on either getByte(seed) or getInt(seed)  therefore these 2 functions are where there needs to be checks for not running off hte end of the array.
    public byte getByte(uint _seed)
    {
        setPosition(_seed);  //don't run off the array
        return bytes[_seed];
    }

    public int getInt(uint _seed) //random data forced into an int from -INT_MAX to INT_MAX
    {
        setPosition(_seed);  //don't run off the array
        return System.BitConverter.ToInt32(bytes, (int)seed);
    }

    public int getInt(int min, int max, uint _seed)
    {
        if (min >= max)
        {
            if (min == max)
                return min;
            //Debug.LogWarning("Min value provided is higher than max.");
            return max + (Mathf.Abs(getInt(_seed)) % (min - max + 1));  //variables reversed
        }
        return min + (Mathf.Abs(getInt(_seed)) % (max - min + 1));
    }


    /// <summary>
    /// return a -1 to 1 float
    /// </summary>
    public float getFloat(uint _seed) 
    {
        return (float)getInt(_seed) / (float)int.MaxValue;
    }

    /// <summary>
    /// return a 0 to 1 float
    /// </summary>
    public float getValue(uint _seed)
    {
        return Mathf.Abs(getFloat(_seed));
    }

    public float getFloat(float min, float max, uint _seed)
    {
        if (min >= max)
        {
            if (min == max)
                return min;
            //Debug.LogWarning("Min value provided is higher than max.");

            return max + (Mathf.Abs(getFloat(_seed)) * (min - max));  //variables reversed
        }

        return min + (Mathf.Abs(getFloat(_seed)) * (max - min));
    }

   
    public bool getBool(uint _seed)
    {
        if (getByte(_seed) >= 128)
            return true;
        return false;
    }

   
    /// <summary>
    /// note that this conversion may possibly be unwanted.
    /// your int gets converted to uint to be assigned to the seed
    /// Having this override keeps the compiler from complaining about it since the chance is 99.9% this is not an issue because we are dealing with random data.
    /// </summary>
    public void setSeed(int _seed)
    {
        setPosition((uint)_seed);  //possibly unwanted conversion?
    }

    public void setSeed(uint _seed)
    {
        setPosition(_seed);
    }

    protected void increment(int byteCount)
    {
        int newPos = (int)seed + byteCount;
        setPosition((uint)newPos);
    }

    /// <summary>
    /// this keeps the seed inside the array
    /// </summary>
    protected void setPosition(uint _seed)
    {
        while (_seed > bytes.Length - 4)
            _seed -= (uint)bytes.Length - 4; //loop around the data.   the -4 must be included here too, or you can get into a case where it just toggles back and forth between the front and back of the array.  (eg imagine a case where the array length is 100 and the seed is 99)         

        seed = _seed;
    }


